import React, {Fragment} from 'react';
import { BrowserRouter } from 'react-router-dom';

import HeaderComponent from './components/HeaderComponent/HeaderComponent';

function App() {
  return (
    <BrowserRouter>
      <Fragment>
        <HeaderComponent />
      </Fragment>
    </BrowserRouter>
  );
}

export default App;
